import React from "react";

class Users extends React.Component {
  constructor(props) {
    super(props)
  }


  render() {
    if (this.users.length > 0)
      return (
        <div>
          {this.users.map((el) => (
            <div className="user" key={el.id}>
              <h3>
                {el.firstName} {el.lastName}
              </h3>
              <p>{el.bio}</p>
              <b>{el.isHappy == true ? 'Schastliv :)' : 'Neschastliv :('}</b>
            </div>
          ))}
        </div>
      );
    else
      return (
        <div className="user">
          <h3>Polzovatelej net</h3>
        </div>
      );
  }
}

export default Users;
